INSERT INTO `pus_katalog` (`replid`, `judul`, `klasifikasi_kode`, `klasifikasi`, `callnumber`, `pengarang`, `penerbit`, `isbn`, `issn`, `penerjemah`, `tahunterbit`, `editor`, `photo2`, `photo`, `kota`, `volume`, `seri`, `edisi`, `halaman`, `dimensi`, `bahasa`, `jenisbuku`, `deskripsi`) VALUES
(1, 'Tiga manula jalan-jalan ke Selatan Jawa`', '741.5', 15, '741.5 RAC t', 14, 4, '9789799106308', '', '', '2013', '', NULL, '', 'Jakarta', '', '', '', 96, '17 cm', 1, 3, 'Pantang menyerah mencari Tingal, desa kelahiran Waluyo, Tiga Manula kini menyusuri Selatan Jawa. Tiga makam presiden diziarahi, Solo-Yogya dinikmati, Candi Borobudur didaki, Nusakambangan dijelajahi, dan beragam kuliner dicicipi. Dimanakah sebenarnya'),
(2, 'Sally Ann thunder Ann whirlwind crockett`', '813', 16, '813 KEL s', 19, 9, '0590969994', '', '', '1995', '', NULL, '', 'New York', '', '', '', 48, '28 cm', 2, 3, 'Sally ann thunder ann is the strongest, fastes woman around. But is she strong enough to rescue Davy Crockett and beat the mighty Mike Fink.'),
(3, 'ari', '700', 8, '', 1, 10, '', '', '', '', '', NULL, '', '', '', '', '', 0, '', 0, 0, ''),
(4, 'Sunshine becomes you`', '823', 12, '823 TAN s', 9, 4, '9789792278132', '', '', '2012', '', NULL, '', 'Jakarta', '', '', '', 432, '20 cm', 1, 3, 'Awalnya, Alex Hirano lebih memilih jauh-jauh dari gadis itu-malaikat kegelapan yang membuatnya cacat. Kemudian Mia Clark tertawa, dan Alex bertanya-tanya bagaimana ia bisa berpikir gadis yang memiliki tawa secerah matahari itu adalah malaikat kegelap'),
(5, 'Hiu dan monster bawah laut`', '597.3', 14, '597.3 BAR h', 13, 15, '9786020032825', '', 'KURNIAWAN, Andri', '2012', '', NULL, '', 'Jakarta', '', '', '', 190, '18cm', 1, 3, 'Menampilkan lebih dari 80 hiu paling menakutkan dan terburuk di dunia, lintah, aligator, cumi-cumi dan binatang bawah air lainnya.'),
(6, 'sof', '499.221', 0, 'sof', 0, 0, '', '', '', '', '', '1_23cb60fa53.png', '', 'sof', '', '', '', 0, '', 1, 3, ''),
(7, '5 cm`', '823', 12, '823 DHI 5', 15, 14, '9789790818521', '', '', '2013', 'NUSANTARA, A. Ariobimo', NULL, '', 'Jakarta', '', '', '', 382, '21 cm', 1, 3, 'Sore ini, setelah menyelesaikan halaman terakhir 5 cm-nya Donny Dhirgantoro, saya terdiam lama dan menangis. Buku ini, entah bagaimana, membuat saya memandang dunia, hidup, dan segala sesuatu di sekitar saya, dengan cara yang berbeda.'),
(8, 'Getting around in the city`', '813', 16, '813 ADA g', 20, 10, '0153276509', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 16, '20 cm', 2, 3, 'I kive in the city. It is a big, busy place. There are so many ways to get around in the city.'),
(9, 'Yes you can, Kerry`', '813', 16, '813 APP y', 21, 10, '0153230754', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 16, '20 cm', 2, 3, 'It was the first day of school. Nine young fish were gathered there. Most clustered in a shell waiting for the teacher.'),
(10, 'Huggly''s halloween`', '813', 16, '813 ARN h', 22, 9, '0439324491', '', '', '2002', '', NULL, '', 'New York', '', '', '', 30, '20 cm', 2, 3, 'Huggly and his friends live in the monster world. But sometimes the human world is just too hard to resist. That''s when the fun begins...'),
(11, 'Huggly goes to school`', '813', 16, '813 ARN h', 22, 9, '0439134994', '', '', '2000', '', NULL, '', 'New York', '', '', '', 30, '20 cm', 2, 3, 'Huggly doesn''t realize that his perfect hide-and-seek hiding spot is...a school. Can Huggly and his friends pretend to be people without getting caught.'),
(12, 'Tommy tractor''s new job`', '813', 16, '813 AND t', 23, 11, '1841352578', '', '', '2003', '', NULL, '', 'London', '', '', '', 28, '23 cm', 2, 3, 'Tommy tractor has a very busy job throughout the year on Parship farm. But when farmer peadley becomes ill, life begins to change.'),
(13, 'Lukisan ajaib bidadari`', '823', 12, '823 SUP l', 16, 0, '9792104240', '', '', '2006', '', NULL, '', 'Yogyakarta', '5', 'Pan-pan', '', 28, '25 cm', 1, 3, 'Pan Pan, singkatan dari panda yang pandai, adalah tokoh dari dunia panda. Pan pan adalah panda yang cerdas, setia kawan, dan baik hati. Ia mempunyai sahabat bernama Blonda yg bloon dan mudah terhasut.'),
(14, 'The testament`', '823', 12, '823 GRI t', 11, 4, '9789792261868', '', 'SETIADI, Hendarto', '2010', '', NULL, '', 'Jakarta', '', '', '', 620, '18 cm', 1, 3, 'Troy Phelan, miliader yang sukses berkat kerja keras seumur hidupnya, eksentrik, suka menyendiri dan hidupnya terikat pada kursi roda, memilih mengakhiri riwayatnya dengan terjun dari lantai empat belas gedung perkantorannya.'),
(15, 'Three women looking for love`', '823', 12, '823 VIR t', 10, 4, '9789792289138', '', '', '2012', '', NULL, '', 'Jakarta', '', '', '', 270, '20 cm', 1, 3, 'Kami bertiga dipersatukan takdir sebagai lajang terakhir di angkatan SMA. Berusia kepala tiga, kami senasib-sepenanggungan. Kami saling berbagi, saling menguatkan, juga saling bersaing diam-diam.'),
(16, 'Dia, tanpa aku`', '823', 12, '823 KIN d', 8, 0, '9789792234411', '', '', '2011', '', NULL, '', 'Jakarta', '', '', '', 276, '', 1, 3, 'Ronald, cowok kelas 2 SMA, sudah lama naksir Citra yang masih kelas 3 SMP. Tapi Ronald belum mau PDKT. Ia menunggu sampai Citra masuk SMA, karena itu ia hanya bisa mengamati Citra dari jauh.'),
(17, 'Rustie gets dirty`', '813', 16, '813 CHA r', 24, 12, '', '', '', '2002', '', NULL, '', '', '', 'Little Puppy Tails', '', 8, '17 cm', 2, 1, 'Rustie loves to dig in the garden and play in the leaves. But only clever Rustie knows how to clean up at the end of a dirty day.'),
(18, 'The stories huey tells`', '813', 16, '813 CAM t', 25, 0, '0679885595', '', '', '1995', '', NULL, '', 'New York', '', '', '', 102, '19 cm', 2, 3, 'It isn''t easy being Julians younger brother. When Huey has bad dream, Julian says his are scarier. And when Huey wants to study animal tracks, Julian says he''s too young.'),
(19, 'Everything on Olvera street`', '813', 16, '813 COL e', 26, 10, '0153230959', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 16, '21 cm', 2, 3, 'Last summer I visited my aunt Helen in Los Angeles, California. On my first saturday, Aut Helen enjoyed a late Breakfast.'),
(20, 'Jackrabbit goalie`', '813', 16, '813 CHR j', 28, 0, '0316139750', '', '', '0', '', NULL, '', 'Canada', '', '', '', 48, '21 cm', 2, 3, 'Anxious to make friends in a new town, a young boy lies about his experience as goalie in order to get on the local soccer team.'),
(22, 'Tell me a story of a cake`', 'FIC', 11, 'FIC AGI t', 31, 0, '9796726696', '', '', '2001', '', NULL, '', '', '', '', '', 1, '', 2, 3, 'I''m a big cake. I''m very delicious'),
(23, 'Little lily at clockland`', '813.23', 179, '813.23 ARL l', 34, 0, '9792223193', '', '', '2006', '', NULL, '', 'Jakarta', '', '', '', 23, '', 2, 3, 'Lily and her friends were learning to tell the time at school.'),
(24, '105 cerita alkitab anak kecil`', '220.95', 20, '220.95 RIK 1', 35, 0, '9789796879946', '', 'Santoso Sri Buwono', '2012', '', NULL, '', 'Jakarta', '', '', '', 447, '', 1, 1, 'Buku ini berisikan 105 cerita alkitab favorit yang diceritakan kembali bagi anak kecil.'),
(25, 'Marmut merah jambu`', '823', 12, '823 DIK m', 37, 0, '9786028066648', '', '', '2010', 'ARIESTANTY, Windy', NULL, '', 'Jakarta', '', '', '', 218, '20 cm', 1, 3, 'Momennya lagi pas banget, pikir gue.Seperti yang Ara tadi anjurkan lewat telepon, ini adalah saatnya gue bilang ke Ina kalo gue sangat menikmati malam ini.'),
(26, 'Sleeping beauty`', '813', 16, '813 ROW s', 38, 20, '0721416918', '', '', '1994', '', NULL, '', 'Maine', '', '', '', 30, '18 cm', 2, 1, 'Once upon a time there was a king and queen who had long hoped for a child of their own. When, at last, a baby princess was born, they thought that a good fairy must have been looking after them.'),
(27, 'Paul Bunyan`', '920', 13, '920 KLE p', 39, 10, '0153230819', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 16, '20 cm', 2, 3, 'Paul Bunyan was born in Maine. He was so big, his cradle was put in the ocean. The waves rocked him to sleep.'),
(28, 'The busy busy day`', '813', 16, '813 FRE t', 40, 0, '1845060075', '', '', '2005', '', NULL, '', 'London', '', '', '', 31, '26 cm', 2, 3, 'It''s springtime. Ginger and Floppy decide to spend a busy day in the garden. They put on their gloves and boots and rush outside:'),
(29, 'Can''t you sleep, Little Bear`', '813', 16, '813 WAD c', 41, 22, '9781844284917', '', '', '2005', '', NULL, '', 'London', '', '', '', 30, '26 cm', 2, 3, 'Little Bear cant sleep. There is dark all around him in the Bear Cave. Not even big Bears biggest lantern can light up the darkness of the night outside.'),
(30, 'I like to learn things my way`', '813', 16, '813 MAZ i', 42, 23, '983000497X', '', '', '2003', '', NULL, '', 'Johor Baru', '', '', '', 24, '22 cm', 2, 3, 'Princess Shelly is only four year old, but she faces tremendous presusure from her parents to learn the many social skills and graces that befit her status.'),
(31, 'My body`', '611', 143, '611 ALT m', 43, 24, '9789380152080', '', '', '2011', '', NULL, '', 'Okhla Industrial Are', '', '', '', 25, '28 cm', 2, 1, 'why does the heart beat. why is a skeleton needed. How does the body move.'),
(32, 'The adventures of Hercules`', '741.5', 15, '741.5 POW t', 44, 25, '9781406214277', '', '', '2009', '', NULL, '', 'London', '', '', '', 72, '23 cm', 2, 3, 'The son of a mortal woman and the king of the Gods, Hercules is blessed with extraordinary strenght.'),
(33, 'Theseus and the Minotaur`', '741.5', 15, '741.5 YOM t', 45, 25, '9781406214307', '', '', '2009', '', NULL, '', 'London', '', '', '', 72, '23 cm', 2, 3, 'Theseus, the brave prince of Athens, has performed many great feats, but his most daunting task is yet to come.'),
(34, 'Little red riding hood`', '813', 16, '813 CHI l', 46, 23, '9830001563', '', '', '2003', '', NULL, '', 'Johor Bahru', '', '', '', 24, '22 cm', 2, 3, 'Once upon a time there was a pretty little girl who lived with her parents in a little cottage. She had a grandmother who lived at the far end of the village.'),
(35, 'What lives on your body`', '595.7', 144, '595.7 WOO w', 47, 26, '190246334X', '', '', '2002', '', NULL, '', 'London', '', '', '', 48, '30 cm', 2, 3, 'Did you know that there are millions of microscopic creatures that lives on and inside your body-mostly so small that you don''t even notice them.'),
(36, 'Naga`', '821', 131, '821 TAT n', 49, 8, '01010255', '', 'TYAS, Damaring', '2005', 'RACHMAWATI, Mila', NULL, '', 'Jakarta', '', '', '', 16, '22 cm', 1, 1, 'Ada ratusan cerita mengenai naga dari seluruh dunia. Ada naga galak bernapaskan api yang menjaga timbunan harta karun yang berkilauan.'),
(37, 'What lives under the carpet`', '595.7', 144, '595.7 WOO w', 47, 26, '1902463234', '', '', '2000', 'WARD, Beck', NULL, '', 'London', '', '', '', 48, '30 cm', 2, 3, 'Everthing you ever wanted to know about the world of creepy-crawlies, bugs and insects in and around your home.'),
(38, 'Cerita rakyat:Woiram`', '813.23', 179, '813.23 ELI c', 50, 4, '9796699443', '', 'JOHNSON, Caroline', '2000', 'ENESTE, Pamusuk', NULL, '', 'Jakarta', '', '', '', 24, '', 5, 3, 'Cerita rakyat sebagai akar budaya indonesia, diwariskan dalam tradisi lisan masyarakat. Pelestarian tradisi lisan itu jga tertuang dalam gambar-gambar prangko seri cerita rakyat.'),
(39, 'Cerita rakyat:Danau toba`', '813.23', 179, '813.23 ELI c', 50, 4, '9796698714', '', 'JOHNSON, Caroline', '2000', 'ENESTE, Pamusuk', NULL, '', 'Jakarta', '', '', '', 24, '15 cm', 5, 3, 'Cerita rakyat sebagai akar budaya indonesia, diwariskan dalam tradisi lisan itu juga tertuang dalam gambar-gambar prangko seri cerita rakyat.'),
