(302, 'Phoenix burung api yang sakti`Phoenix magical fire bird', 'FIC', 11, 'FIC USM p', 230, 76, '9789790633889', '', 'Midah Novitasari', '2012', 'Melvi Dwi Dezka Putri', NULL, '', 'Jakarta', '', '', '', 16, '21,5 Cm', 5, 3, 'Pada zaman dahulu kala di daerah mesir, Phoenix si burung api dikenal dengan nama Bennu. Bennu digambarkan memiliki bulu yang berwarna merah keemasan. Bila disinari mataharibulu yang merah keemasan itu seperti nyala api.'),
(303, 'Naga ular besar yang menyemburkan api`Dragon huge snake that cast out the fire', 'FIC', 11, 'FIC USM n', 230, 76, '9789790633926', '', 'Midah Novitasari', '2012', 'Melvi Dwi Dezka Putri', NULL, '', 'Jakarta', '', '', '', 17, '20,5 Cm', 5, 3, 'Cerita ular naga sudah dikenal seluruh dunia sejak lama, terutama dinegeri Cina. Bahkan sungai besar di Cina dipercaya berasal dari dari kekuatan naga.'),
(304, 'Barnabas helps a friend`', 'FIC', 11, 'FIC LEP b', 158, 35, '9780310715856', '', '', '2008', '', NULL, '', 'Michigan', '', '', '', 32, '15 Cm', 2, 3, 'Oh no a tree fell on Mr.Beaver''s house. Barnabas and Russell try to pushit off. But the tree is to heavy. Friends are supposed to help when trouble comes.'),
(305, 'Jill and the giant`', 'FIC', 11, 'FIC VER j', 231, 10, '0153230460', '', '', '0', '', NULL, '', 'New York', '', '', '', 16, '13,5 Cm', 2, 3, 'Jill and her granpa had nothing to eat.\nJill took the cow to town. She traded the cow and came back with some seeds.'),
(306, 'Birthday cookies`', 'FIC', 11, 'FIC VER b', 232, 10, '0153230495', '', '', '0', '', NULL, '', 'New York', '', '', '', 16, '13,5 Cm', 2, 3, 'Today mama birthday, papa always makes a yellow cake for mama but papa sick today...\nWhat can we do...'),
(307, 'Alfred`', 'FIC', 11, 'FIC VIG a', 233, 23, '9830003469', '', '', '2003', '', NULL, '', 'Selangor', '', '', '', 22, '21 Cm', 2, 3, 'Alfred the elephant has a very long trunk. He is ashamed of his trunk and triesall he canto hide or disguise it. But one day, something happens and makes alfred realize that his trunk is special...'),
(308, 'Let''s visit the zoo`', '590', 141, '590 MOR l', 234, 10, '0153275952', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 12, '13,5 Cm', 2, 3, 'Look at the monkeys.Monkeys have along tails.'),
(309, 'Don''t let the pigeon drive the bus`', 'FIC', 11, 'FIC WIL d', 235, 22, '9781844285136', '', '', '2003', '', NULL, '', 'London', '', '', '', 1, '23 Cm', 2, 3, 'I thought he''d never leave.\nHey, can i drive the bus....'),
(310, 'Naked mole rat gets dressed`', 'FIC', 11, 'FIC WIL n', 235, 22, '9781406321371', '', '', '2009', '', NULL, '', 'London', '', '', '', 1, '27 Cm', 2, 3, ''),
(311, 'Little humpty`Si unta kecil', 'FIC', 11, 'FIC WIL l', 236, 47, '9789790750081', '', 'Hanantyo Abhinowo', '2009', 'Winny Rachmayanti', NULL, '', 'Jakarta', '', '', '', 34, '22 Cm', 5, 3, 'Tahukah kmu unta kecil di dunia ini kamulah yang paling ibu sayangi,\nCeritakanlah kepadaku tentang dunia ibu.'),
(312, 'Augustine`', 'FIC', 11, 'FIC WAT a', 237, 47, '9789790750272', '', 'Fitria A', '2006', 'Winny Rachmayanti', NULL, '', 'Jakarta', '', '', '', 32, '22 Cm', 5, 3, 'Pindah dari kutub selatan ke kutub utara bukanlah hal yang mudah bagi Augustine. Ia merindukan kamar tidurnya. Namun dengan bantuan pensil warna dan inspirasi  dari Piccaso, pinguin kecil yang pemalu dan artistik.'),
(313, 'Bella gets her skates on`', 'FIC', 11, 'FIC WHY b', 238, 77, '9781447202691', '', '', '2007', '', NULL, '', 'London', '', '', '', 1, '25 Cm', 2, 3, 'Ben and Sophie are excited about going skating on the frozen lake.'),
(314, 'Lusy Goosey`Lusi si angsa', 'FIC', 11, 'FIC WIL l', 236, 47, '9789790750074', '', 'Hanantyo Abhinowo', '2007', 'Winny Rahcmayanti', NULL, '', 'Jakarta', '', '', '', 32, '22 Cm', 5, 3, 'Lusi tidak ingin pergi meninggalkan kolam, meskipun itu berarti ia akan tertinggal. Namun, ketika lusi sadar bahwa dia sedang sendirian ia harus mengambil keputusan berani. Lebih menakutkan untuk hidup seorang diri atau pergi menghadapi ketakutan ter'),
(315, 'Timothy goes to school`', 'FIC', 11, 'FIC WEL t', 239, 9, '0439227070', '', '', '2000', '', NULL, '', 'New York', '', '', '', 30, '21,5 Cm', 2, 3, 'Timothy is very excited about starting school.Until he meets claude.'),
(316, 'Tug Takes on a job`', 'FIC', 11, 'FIC WIT t', 240, 23, '9835038929', '', '', '2003', '', NULL, '', 'Selangor', '', '', '', 24, '19 cm', 2, 3, 'Tug sees a lot of rubbish in the park where he and his friends play.'),
(317, 'An Afternoon`', 'FIC', 11, 'FIC WIS a', 241, 10, '0153229713', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 12, '13,5 Cm', 2, 3, 'This morning the shops on the streets are very busy.'),
(318, 'Mr.smart''s big dog book`', 'FIC', 11, 'FIC WEL m', 242, 10, '0153230207', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 12, '13 Cm', 2, 3, 'I wonder.How much do i give Arf to eat.\nYou start with part of a can Mr. Smart.'),
(319, 'Justin''s alligator`', 'FIC', 11, 'FIC WID j', 243, 10, '0153230886', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 16, '13,5 Cm', 2, 3, 'Justin knew it was not the best idea to bring back an alligator from vacation.He knew that.'),
(320, 'Tales of mr.map`', 'FIC', 11, 'FIC WIL t', 244, 10, '0153230266', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 16, '13,5 Cm', 2, 3, 'A big giant came in the gate.He was lost.'),
(321, 'Scout takes too much`', 'FIC', 11, 'FIC WIT s', 240, 23, '9835038910', '', '', '2003', '', NULL, '', 'Selangor', '', '', '', 24, '19 Cm', 2, 3, 'After a party in the park, Scout tries to take all of the fruit and vegetables left on the table for himself.'),
(322, 'Larry''s baby boa`', 'FIC', 11, 'FIC YEO l', 245, 10, '015323086x', '', '', '0', '', NULL, '', 'Orlando', '', '', '', 16, '13,5 cm', 2, 3, 'How was pet day at school.\nIt was okay but peepers got chocolate pidding and grass all over him.'),
(323, 'George''s farm peek a boo baby`', 'FIC', 11, 'FIC YOY g', 246, 2, '0710512805', '', '', '0', '', NULL, '', 'Indonesia', '', '', '', 1, '15 Cm', 2, 1, 'Who''s that on the farm, It''s George. George and all of his animal friends.'),
(324, 'George''s farm peek a boo sounds`', 'FIC', 11, 'FIC YOY g', 246, 2, '0710512805', '', '', '0', '', NULL, '', 'Indonesia', '', '', '', 1, '15 Cm', 2, 1, 'Peek through the windows on each page to discover all the wonderful surprise on George farm.'),
(325, 'Here comes the crocodile`Ini dia si buaya', 'FIC', 11, 'FIC WHI h', 247, 47, '9789790333000', '', 'Hertiani Agustine', '2008', 'Sindi Merian, S.Hum', NULL, '', 'Jakarta', '', '', '', 30, '28 Cm', 5, 3, 'Ini dia si buaya datang sambil mengendus,menggera, dan menggemeretak.\nSuara gemuruh datang dari perut besarnya.\nOh, tidak si buaya sedang lapar...Lari...'),
(326, 'Me and my dad`Aku dan ayahku', 'FIC', 11, 'FIC RIT m', 248, 47, '9797819957', '', 'Eka Cahyani', '2007', 'Mila Rachmawati', NULL, '', 'Jakarta', '', '', '', 26, '28 Cm', 5, 3, 'Beruang kecil dan ayahnya melakukan banyak kegiatan yang menyenangkan, menjelajahi gunung yang tingg, berenang saat hujan dan bercerita saat bintang muncul di langit.Mereka melakukan bersama-sama.'),
(327, 'Animal story time`The cygnet and the stork, the hippo and the cheetah', 'FIC', 11, 'FIC BOO a', 249, 78, '9781742023991', '', '', '2011', '', NULL, '', 'Sydney', '', '', '', 8, '21 Cm', 2, 1, 'Downy the cygnet is bullied off his beach,\nHarriet the hippo is teased for being too heavy,\nHow do they overcome their problems...'),
(328, 'Animal story time`Leo the lion cub timmy the turtle', 'FIC', 11, 'FIC BOO a', 249, 0, '9781742124004', '', '', '2011', '', NULL, '', 'Sydney', '', '', '', 8, '21 Cm', 2, 1, 'Leo the lion cub can''t find his roar.\nTimmy turtle is just too slow.\nHow do they overcome their problem.'),
(329, 'Messy me`', 'FIC', 11, 'FIC MCG m', 250, 21, '9781848951518', '', '', '2011', '', NULL, '', 'London', '', '', '', 16, '20 Cm', 2, 1, 'Messy bouncing,Messy bed.\nMessy feather round my head.\nMessy milk and messy tray.\nMy Messy breakfast starts the day.'),
(330, 'Dorothy & mikey`', 'FIC', 11, 'FIC KAS d', 251, 44, '9789791534154', '', 'Lulu Wijaya', '2007', '', NULL, '', 'Jakarta', '', '', '', 30, '22 Cm', 5, 3, 'Dorothy dan Mikey bersahabat. Tapi kalau sedang bermain, mereka suka bersaing.\nTiap hari selalu ada yang menang dan ada yang kalah dalam persahabatan yang lucu dan mengharukan.'),
(331, 'Emily''s tiger`', 'FIC', 11, 'FIC LAT e', 254, 79, '9781846865947', '', '', '2008', '', NULL, '', 'China', '', '', '', 1, '21,5 Cm', 2, 3, 'Emily is off and running again,This little girl has a problem with her temper, and every time she gets angry she turns into quite the little tiger.'),
(332, 'Follow that bear if you dare`', 'FIC', 11, 'FIC FRE f', 40, 21, '9781845065676', '', '', '2009', '', NULL, '', 'London', '', '', '', 1, '26 Cm', 2, 3, 'When going on a hunt, to find a bear, You need to take the utmost care.It''s best to take a friend along too,Choose one that looks much fetter than you.'),
(333, 'Puss in boots`', 'FIC', 11, 'FIC MOT p', 255, 80, '9831914821', '', '', '2003', '', NULL, '', 'Kuala Lumpur', '', '', '', 1, '25 Cm', 2, 3, 'Find out how a clever cat help a poor young man find his fortune and the beautiful princess to marry.This version of famous story has been carefully edited and adapted for very young readers.'),
(334, 'Safari pals`Mengikuti jejak', 'FIC', 11, 'FIC KIL s', 256, 47, '9789790990593', '', 'Widyasari', '2010', 'Ayu Prameswary', NULL, '', 'Jakarta', '', '', '', 16, '22 Cm', 5, 3, 'Kai Lan menemukan jejak misterius. Hanya ada satu hal yang bisa dilakukan mengajak teman-temannya berpetualang untuk menemukan siapa yang membuat jejak-jejak itu.'),
(335, 'Rory''s story`', 'FIC', 11, 'FIC FIV r', 257, 81, '9781743003268', '', '', '2012', '', NULL, '', 'Victoria', '', '', '', 26, '24 Cm', 2, 3, 'Rory the tiger is having a terrible time. He has a new baby sister.\nShe''s too small to play with, she cries a lot, and everyone seems to have forgotten a bout him.'),
(336, 'Geoffrey and the giant`', 'FIC', 11, 'FIC THO g', 258, 50, '9781849560955', '', '', '2010', '', NULL, '', 'China', '', '', '', 1, '20,5 Cm', 2, 1, 'Children we love to follow brave knight, Geoffrey, as he hunts for a noisy giant then unfoldthe bookto reveal hidden giant.'),
(337, 'David and goliath`', '222', 169, '222 PAG d', 259, 82, '1846101735', '', '', '2006', '', NULL, '', 'China', '', '', '', 31, '15 Cm', 2, 1, 'Long time ago things were bad for israel..\nAt war with the Philistines and not doing well.'),
(338, 'Sari suka bersolek`', '823', 12, '823 ADI s', 260, 83, '9794300446', '', 'Dicky Sutadi', '2001', '', NULL, '', 'Jakarta', '', '', '', 18, '25 Cm', 4, 3, 'Sari seekor bangau yang cantik. Supaya tidak ketinggalan zaman, ia meniru dandanan teman-temannya.Apakah ia kelihatan cantik..'),
(339, 'Night,night,baby`', '811', 154, '811 MER n', 261, 84, '', '', '', '0', '', NULL, '', '', '', '', '', 8, '21 Cm', 2, 1, 'Flip the flap and see who''s there, behind the bunny or panda bear.'),
(340, 'Lettice`', 'FIC', 11, 'FIC STA l', 120, 85, '9780007847624', '', '', '2011', '', NULL, '', 'London', '', '', '', 26, '22,5 Cm', 2, 3, 'Lettice rabbit longs to fly but even when she flaps her arms and ears she can''t seem to lift off the ground.'),
